import { useSelector } from "react-redux"

const FilterList = () => {
    const { filters } = useSelector(state => state.filter)

    return (
        <div>
            <h1>Filters</h1>
            {filters.map(filter => (filter.criterion))}
        </div>
    )
}

export default FilterList
